#define N 10000000  //Tamanho da String

int tamanhoDoGrafo(node grafo) {
    if(grafo == NULL) return 0;
    int x = 0;
    if(grafo->tipo == -64 || grafo->tipo == -100) {
        x = 1;
        if(grafo->esq != NULL) {
            x += tamanhoDoGrafo(grafo->esq);
        }
        if(grafo->dir != NULL) {
            x += tamanhoDoGrafo(grafo->dir);
        }
    }
    return x;
}

int tamanhoDaHeapUtilizada() {
    return tamanhoDoGrafo(rootGrafo) + 18;
}

int tamanhoDaFreeList() {
    int i = 0;
    node aux;
    for(aux = freeList ; aux->esq != NULL ; aux = aux->esq) {
        i++;
    }
    return i;
}

void informacoesSobreAHeap() {
    int heaputilizada = tamanhoDaHeapUtilizada();
    int tamanhofreelist = tamanhoDaFreeList();
    printf("\nCelulas:\nTotal\t\t= %i", H);
    printf("\nUtilizadas\t= %i",heaputilizada);
    printf("\nFreeList\t= %i",tamanhofreelist);
    printf("\nLixo\t\t= %i",H-heaputilizada-tamanhofreelist);
}

